import { Link } from "react-router-dom";
export default function Index() {
    return (
        <main className="min-vh-100 col-md-12 m-auto align-middle pt-5">
            <h1 className="text-center p-2">Registration</h1>

            <form className="form-group col ">
                <div className="col-md-6 m-auto">
                    <label className="col-12">Email:</label>
                    <input type="text" name="email" className="col-12" placeholder="Email" />
                </div>
                <div className="text-center">
                    <button type="button" className="btn btn-dark m-3">Submit</button>

                </div>
            </form>
            <Link to="/login">
                <h6 className="text-center"><u>Login</u></h6>
            </Link>
        </main >
    );
}
